script: |
  super -f text -I q9060.spq | sort > q9060.out

inputs:
  - name: q9060.spq
    data: |
      SELECT ALL - + col0 + col1 / + - col1 + + col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + col1 * col1 / + ( + + 36 ) >= - - 74 * + + col2 + - 76;
  - name: tab2

outputs:
  - name: q9060.out
    data: |
      -18
      -24
      -25
